import React from "react";

const Newsletter = () => {
  return (
    <div className="newsContainer">
      <h1>Subscirbe To Our Newletter</h1>
      <h3>And keep updated for future developments and discounts.</h3>

      <input type="email" placeholder="example@google.com"></input>
      <input
        type="submit"
        onClick={() =>
          alert("Yep..just a place holder, no mail spamming here.")
        }
      ></input>
    </div>
  );
};
export default Newsletter;
